import React, { Component } from "react";
import "@material-ui/core";
import {
  List,
  ListItem,
  ListItemText,
  Card,
  CardContent,
  Typography,
} from "@material-ui/core";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams,
} from "react-router-dom";

import "./App.css";
import logo from "./logo.png";
import Twitts from "./Twitts";
import Charts from "./Charts";

function App() {
  /**
   *
   */
  return (
    <div className="app">
      <div className="landing_page">landing page</div>
      <div className="app_left"></div>
      <img src={logo} style={{ display: "flex", width: "100%" }}></img>
      <div className="navigation">
        <List>
          {["HOME", "CDU", "SPD", "AFD", "FDP", "LINKE", "GRÜN"].map((text) => (
            <ListItem button key={text}>
              <ListItemText primary={text} className="list" />
            </ListItem>
          ))}
        </List>

        <div className="app_right">
          <Twitts />
          <Charts />
        </div>
      </div>
    </div>
  );
}

export default App;
